import React, {Component} from "react";
import Item from "./Item"

export default function ItemList({items}) {
    const itemElements = items.map(item =>
        <li key={item.id}><Item item = {item}/></li>);
    return(
        <ul style={{}}>
            {itemElements}
        </ul>
    )
}
